(78595, 237398, 7143, 3, 'Planet Caravan', '　　Ozzy Osbourne的音樂成就無庸置疑，對後輩們影響甚鉅。活躍歌壇40年歲月，從代表英國金屬文化的Black Sabbath誕生，他的造型以及現場狂放演出，一再震撼全球搖滾歌壇，光榮音樂史至今仍持續譜寫著。單是個人演唱生涯，就締造出全球七千五百萬張專輯銷售量，提攜新秀更是不遺餘力，創辦全美一年一度搖滾盛會Ozzfest發掘潛力新人。<br /><br />　　發行於1970年的第二張專輯【Paranoid】，創下英國唯一冠軍紀錄+美國Top12，英國大破六白金，美國則是四白金銷售加冕，專業網站AMG+音樂雜誌Blender全奉上五星滿分評價，雙獲滾石雜誌「史上最佳哥德專輯」+「史上五百張經典專輯」第130名推崇、Vibe雜誌「百大20世紀經典專輯」、Guitar World的「史上百大經典吉他專輯」第六名之好評。', '2009-03-30 00:00:00', 2009, 19, 0, 7, '', '', 0, '', '', '', '', '', '', 0, 0, 0, '2014-09-09 20:07:30', '2015-03-12 14:08:37', '0000-00-00 00:00:00'),
